import React, { useState, useEffect } from 'react';
import './TimetableResults.css';
import { getTimeSlots } from '../services/api';

const TimetableResults = () => {
  // IMPORTANT: Replace this with the public URL of your backend deployed on Hugging Face Spaces.
  // The '/interactive/' part is the route we defined in app.py for the Dash app.
  const dashAppUrl = "https://your-huggingface-space-url/interactive/";

  // A simple check to ensure a placeholder isn't used.
  if (dashAppUrl.includes("your-huggingface-space-url")) {
    return (
      <div className="results-section" style={{ textAlign: 'center', padding: '40px' }}>
        <h3 style={{ color: '#dc3545' }}>Configuration Needed</h3>
        <p>
          Please update the <code>dashAppUrl</code> in <code>TimetableResults.js</code> to point to your deployed backend URL.
        </p>
      </div>
    );
  }

  return (
    <section className="results-section">
      <div className="results-header">
        <div className="results-header-left">
          <div className="results-icon">âœ“</div>
          <h3 className="results-title">Interactive Timetable</h3>
        </div>
      </div>

      <div className="iframe-container">
        <iframe
          src={dashAppUrl}
          title="Interactive Timetable Editor"
          className="timetable-iframe"
          // Optional sandbox attribute for security, may need to adjust permissions
          // sandbox="allow-scripts allow-same-origin allow-forms allow-popups"
        >
          <p>Your browser does not support iframes. Please use a modern browser to view the interactive timetable.</p>
        </iframe>
      </div>
    </section>
  );
};

export default TimetableResults;
